import './Header.css';
import AccountCircleIcon from '@material-ui/icons/AccountCircle';

function Header(){
    return(
        <div className='header'>
        <h2>I'm the header</h2>
        <AccountCircleIcon font/>
        </div>
    );
}

export default Header;
